import { Link } from 'react-router-dom';

function NavBar() {
  return (
    <header style={headerStyle}>
      <div style={titleContainer}>
        <Link to="/home" style={titleStyle}>Closet 1821</Link>
      </div>
      <nav style={navStyle}>
        <Link to="/home" style={linkStyle}>Shop</Link>
        <Link to="/add" style={linkStyle}>Add Items</Link>
        <Link to="/account" style={linkStyle}>Account</Link>
        <Link to="/feedback" style={linkStyle}>Feedback</Link>
      </nav>
    </header>
  );
}

const headerStyle = {
  backgroundColor: '#000',
  color: '#fff',
  position: 'fixed',
  top: 0,
  width: '100%',
  zIndex: 1000,
  padding: '10px 20px',
};

const navContainerStyle = {
  display: 'flex',
  justifyContent: 'space-between',
  alignItems: 'center',
  maxWidth: '1200px',
  margin: '0 auto',
};

const titleLinkStyle = {
  color: '#fff',
  textDecoration: 'none',
  fontSize: '1.8em',
  fontWeight: 'bold',
};

const navStyle = {
  display: 'flex',
  gap: '20px',
};

const linkStyle = {
  color: '#fff',
  textDecoration: 'none',
  fontWeight: 'bold',
  fontSize: '1em',
};

export default NavBar;
